import './App.css';
import { DataProvider } from "./components/AppContext";
import { BrowserRouter, Navigate, Route, Routes } from "react-router-dom";






function App() {
  
 
  return (
 <>
  <DataProvider>
      {/* <SnakBar /> */}
      <BrowserRouter>
        <Routes>

          <Route index element={<Login />} />
          <Route path="/CreateAccount" element={<CreateAccount />} />
          <Route path="DistanceCalculation" element={<DistanceCalculation />} />
          <Route path="/" element={<Layout />} >
          <Route path="estimates/add" element={<EstimatesAdd />} />
          <Route path="estimates" element={<Estimates />} />
          <Route path="estimates/Preview/:id" element={<EstimatesPreview />} />
      
          
          </Route>
        </Routes>

      </BrowserRouter>
    </DataProvider>

 </>
  );
}

export default App;
